import React, { Component } from 'react'
export class Obsdata extends Component {
    constructor(props) {
        super(props);
        console.log(props);
        this.obsdata={
          temp:0
        };
        props.obsdata.forEach(obsField => {
          switch(obsField.elementName){
            case 'TEMP': this.obsdata.temp=obsField.elementValue;break;
            case 'HUMD': this.obsdata.temp=obsField.elementValue;break;
            default:
              break;
          }

        });

      };
    render() {
        return (

        <div>
            <div>{this.obsdata.temp}</div>

        </div>
        )
    }
}
export default Obsdata
